import './AboutSection.css';

export default function AboutSection(){
    return(
        <div className="container-fluid about-section-parent-wrapper py-5">
            <div className="container about-section-child-wrapper py-3">
                <div className="about-section-content-wrapper">
                    <h2 className="about-section-main-heading col-12 col-sm-12 col-md-6">
                        Designed For Graduates and Students by Graduates
                    </h2>
                    <p className="about-section-description-text col-12 col-sm-12 col-md-6 mt-4">
                        Founded By Dinielia Pillay, Designed and Developed by Faith , 
                        <strong>SOAR</strong> Is An Online Digital Hub For Resources For Recent Graduates and  Students Who Are Looking To Further Their Careers In The STEM Field. SOAR Provide Students With Recent Graduates Program Opportunities and Internships.
                    </p>
                </div>
            </div>
        </div>
    );
}
